def kalman(u):
    p = 500
    r = 40 #50
    h = 1
    q = 0.7 #0.6
    k = 0
    new = [0] * len(u)
    u_hat = 0
    for i in range(0,len(u)):
        k = p*h/(h*p*h+r)
        u_hat = u_hat+k*(u[i] - h*u_hat)
        new[i] = u_hat
        p = (1-k*h)*p+q
    return new

